function checkFinality(){$("#non-residential-div").hide(),$("#finalidade").val()==$("#non-residential-div").data("accept")&&$("#non-residential-div").fadeIn()}$("#tenant").autocomplete({source:function(e,t){$.ajax({url:"/tenants/fetch.json",data:{name:e.term},dataType:"json",success:function(e){t(e)}})},select:function(e,t){return $("#tenant").val(t.item.nome+" - "+t.item.formatted_username),$("#tenant-id").val(t.item.tenant.id),!1}}).autocomplete("instance")._renderItem=function(e,t){var n={name:t.nome,username:t.formatted_username};return $("<li>").append($("#tenants-search-template").tmpl(n)).appendTo(e)},$("#property").autocomplete({source:function(e,t){$.ajax({url:"/properties/fetch.json",data:{name:e.term},dataType:"json",success:function(e){t(e)}})},select:function(e,t){return $("#property").val(t.item.full_address),$("#property-id").val(t.item.id),!1}}).autocomplete("instance")._renderItem=function(e,t){var n={photo:t.main_photo,address:t.full_address,code:t.formatted_code,locator:t.locator.user.nome,locator_username:t.locator.user.formatted_username};return $("<li>").append($("#properties-search-template").tmpl(n)).appendTo(e)},$("#finalidade").length&&checkFinality(),$("#finalidade").change(function(){checkFinality()});